B.MI=new A.fO("We process your data to insure that you get the best fit for you of our services and to always improve them.",null)
B.aqH=new A.fO("Each party is obliged to keep strictly confidential of any company business secrets or technical information or any knowledge related to the other partyCamion is responsible for securing your all your data inside the system, including your business info, reports and \u2026.etc. You have to keep your password strict and not to give it to any other unauthorized person.You are responsible to keep all the info about Camion\u2019s process and system safe as well, including the reports, data analysis, prices and \u2026.etc.And hereby, Camion is authorized to record all thecalls between you and our Customer Service Team.Disclaimer: Camion disclaims all warranties of any kind.",null)
B.aqI=new A.fO("Once you use our application or website we are authorized to access your device location in order to improve our booking system and to improve locating our trucks and mini-trucks. Overall, in order to improve our services to best fit you.",null)
B.aqJ=new A.fO("Camion is promising you a high quality service with a very organized and detailed-oriented system to cover all the transportation process.We provide the Shipper with the Insurance Service with very professional entities and with relatively low prices; the trip insurance will cover the compensation of damaged or lost items during the trip *check appendix 1 for more details of the insurance process*, however, it is an optional service that the Shipper might not choose, but, in case of not choosing it, s/he is totally responsible for the goods safety.",null)
B.aqK=new A.fO("We are always here to help you and serve you in the best way we can. For complaints, you can contact our Customer Service Team either by calling us on, sending an email to info@camion.com, sending a message through our Contact Us tab or by having a chat with us.",null)
B.aqL=new A.fO("Any Data that identifies a natural person directly or indirectly such as (Name, Identification Number, Email, Password to Protect Your Account).",null)
B.aqM=new A.fO("Camion is promising you a high quality service with a very organized and detailed-oriented system to cover all the transportation process.We provide you with the Insurance Service with very professional entities and with relatively low prices; the trip insurance will cover the compensation of damaged or lost items during the trip *check appendix 1 for more details of the insurance process*, however, it is an optional service that you might not choose, but, in case of not choosing it, you are totally responsible for the goods safety.",null)
B.aqN=new A.fO("Shipper shall pay the fees (as agreed), also parking charges (if there is any), tolls and weights (if there is any) and any extra fees occur during the trip. Invoices will be introduced to the Shipper at delivery and s/he will have to pay it before the discharge of the goods at the end point, or as the agreed on process if s/he is having a special contract with us. In case the Shipper has a representative from his/her side with our driver, the driver is the only one who is allowed to deal with the tolls and weights all the time.",null)
B.aqO=new A.fO("Camion is giving the Fleet Owners only 1 hour to place a bid on a request; there will be a timer showing you how much time is remaining for bidding on a certain request.",null)
B.aqP=new A.fO("Once you use our application or website we are authorized to access your device location in order to improve our booking system and to improve locating our trucks and mini-trucks.Overall, in order to improve our services to best fit you.",null)
B.aqQ=new A.fO("We collect data such as: Real Name, Email Address, Password, Location Information, Device Information, Address and Credit Card Information.",null)
B.aqR=new A.fO("Each party is obliged to keep strictly confidential of any company business secrets or technical information or any knowledge related to the other partyCamion is responsible for securing your all your data inside the system, including your business info, reports and \u2026.etc. You have to keep your password strict and not to give it to any other unauthorized person.You are responsible to keep all the info about Camion\u2019s process and system safe as well, including the reports, data analysis, prices and \u2026.etc.And hereby, Camion is authorized to record all the calls between you and our Customer Service Team.",null)
B.aqS=new A.fO("Camion is promising you to have a minimum of 3 bids within 2 hours after placing a request as a max.However, you will receive a pop-up message every time you request a trip that shows you a reversed timer where you have to accept or reject the offers made to you before it went out.The time for request confirmation after getting the bids is up to 5 hours, ignoring the offers by either not accepting or rejecting them till the time is up for 3 times you will have your account blocked for a week, if you repeat it for extra 2 times you will have your account suspended for a month, and then those procedures will be repeated..",null)
